const Import = async () => {
  const [IMP, setIMP] = useState(null);

  await useEffect(() => {
    const { IMP } = window;
    // console.log(IMP);
    setIMP(IMP);
  }, []);

  await IMP.init("imp37098043");
  // const keys = Object.keys(IMP);
  // console.log(keys);
  return (
    <>
      <h1>test</h1>
    </>
  );
};

export default Import;
